//-------- states and transitions --------//
void InitializeStatesAndTransitions(vector<State>& states,
		vector<Transition>& transitions) {

	//currently the states and transitions define a global alignment model
	//to do global-local alignment model, needs to define two more states at least.

	//define states
	states.clear();
	transitions.clear();
	State alignState1;
	alignState1.name = STATE_MATCH;
	alignState1.type = StateType_MATCH;
	alignState1.emit_x = 1;
	alignState1.emit_y = 1;

	State insertXState;
	insertXState.name = STATE_INSERT_X;
	insertXState.type = StateType_INSERT_X;
	insertXState.mtype = 3;
	insertXState.stype = 1;
	insertXState.emit_x = 1;
	insertXState.emit_y = 0;

	State insertYState;
	insertYState.name = STATE_INSERT_Y;
	insertYState.type = StateType_INSERT_Y;
	insertYState.mtype = 0;
	insertYState.stype = 2;
	insertYState.emit_x = 0;
	insertYState.emit_y = 1;

	states.push_back(alignState1);
	states.push_back(insertXState);
	states.push_back(insertYState);

	//define transitions
	for (int i = 0; i < (int)states.size(); i++)
		for (int j = 0; j < (int)states.size(); j++) {
			if (states[i].type == StateType_INSERT_Y && states[j].type
					== StateType_INSERT_X)
				continue;
			Transition trans;

			if (states[i].type == StateType_MATCH) {
				if (states[j].type == StateType_MATCH)
					trans.ttype = tM2M;
				if (states[j].type == StateType_INSERT_X)
					trans.ttype = tM2IX;
				if (states[j].type == StateType_INSERT_Y)
					trans.ttype = tM2IY;

			}
			if (states[i].type == StateType_INSERT_X) {
				if (states[j].type == StateType_MATCH)
					trans.ttype = tIX2M;
				if (states[j].type == StateType_INSERT_X)
					trans.ttype = tIX2IX;
				if (states[j].type == StateType_INSERT_Y)
					trans.ttype = tIX2IY;

			}
			if (states[i].type == StateType_INSERT_Y) {
				if (states[j].type == StateType_MATCH)
					trans.ttype = tIY2M;
				if (states[j].type == StateType_INSERT_Y)
					trans.ttype = tIY2IY;
			}

			trans.from = i;
			trans.to = j;
			transitions.push_back(trans);
		}

}


//------- int2string -----//
string convertInt(int number)
{
	stringstream ss;  //create a stringstream
	ss << number;     //add number to the stream
	return ss.str();  //return a string with the contents of the stream
}

//-------------------- fasta related -----------------//
int ReadToFile_FASTA(string &fn,vector<pair<int, int> > &alignment,
	string &nam1_content,string &nam2_content,string &nam1_full,string &nam2_full,
	string &nam1,string &nam2,int &idrate)
{
	int i;
	int cur1=0;
	int cur2=0;
	int len;
	int len1,len2;
	int lali,match;
	alignment.clear();
	//init
	string seq="";  //sequence
	string tmp="";  //template
	//load
	ifstream fin;
	string buf,temp;
	fin.open(fn.c_str(), ios::in);
	if(fin.fail()!=0)
	{
		fprintf(stderr,"alignment file not found [%s] !!!\n",fn.c_str());
		return -1;
	}
	//read tmp
	for(;;)
	{
		if(!getline(fin,buf,'\n'))goto badend;
		len=(int)buf.length();
		if(len>1)
		{
			if(buf[0]=='>')
			{
				istringstream www(buf);
				www>>temp;
				len=(int)temp.length();
				nam1=temp.substr(1,len-1);
				break;
			}
		}
	}
	for(;;)
	{
		if(!getline(fin,buf,'\n'))goto badend;
		len=(int)buf.length();
		if(len==0)continue;
		if(len>1)
		{
			if(buf[0]=='>')
			{
				istringstream www(buf);
				www>>temp;
				len=(int)temp.length();
				nam2=temp.substr(1,len-1);
				break;
			}
		}
		tmp+=buf;
	}
	//read seq
	for(;;)
	{
		if(!getline(fin,buf,'\n'))break;
		len=(int)buf.length();
		if(len==0)continue;
		seq+=buf;
	}
	//process
	len1=(int)seq.length();
	len2=(int)tmp.length();
	if(len1!=len2)
	{
		fprintf(stderr,"alignment len not equal [%s] !!!\n",fn.c_str());
		return -1;
	}
	len=len1;
	nam1_content.clear();
	nam2_content.clear();
	idrate=0;
	lali=0;
	match=0;
	for(i=0;i<len;i++)
	{
		if(tmp[i]!='-' && seq[i]!='-') //match
		{
			nam1_content.push_back(tmp[i]);
			nam2_content.push_back(seq[i]);
			cur1++;
			cur2++;
			alignment.push_back(pair<int,int>(cur1,cur2));
			//calculate sequence idenrity
			if(tmp[i]==seq[i])match++;
			lali++;			
		}
		else
		{
			if(tmp[i]!='-') //Ix
			{
				nam1_content.push_back(tmp[i]);
				cur1++;
				alignment.push_back(pair<int,int>(cur1,-cur2));
			}
			if(seq[i]!='-') //Iy
			{
				nam2_content.push_back(seq[i]);
				cur2++;
				alignment.push_back(pair<int,int>(-cur1,cur2));
			}
		}
	}
	//return
	nam1_full=tmp;
	nam2_full=seq;
	idrate=match;
	return 1; //success

badend:
	fprintf(stderr,"alignment file format bad [%s] !!!\n",fn.c_str());
	return -1;
}

//------- detect alignment range ---------//
string detect_alignment_range(string path,pair<int,int> & template_range,pair<int,int> & query_range,vector<int> & aaa,int &idrate)
{
	vector<pair<int,int> > alignment;string nam1_content,nam2_content,nam1_full,nam2_full,nam1,nam2;
	ReadToFile_FASTA(path,alignment,nam1_content,nam2_content,nam1_full,nam2_full,nam1,nam2,idrate);
	//---- init check length ----//
	if(nam1_full.length()!=nam2_full.length() || nam1_full.length()!= alignment.size())
	{
		cout<<path<<" alignment wrong!"<<endl;
		exit(1);
	}	
	
	//-------- get start and end pos -------//
	int align_start, align_end;
	int temp_start,temp_end,query_start,query_end;
	align_start=0;
	align_end=0;
	temp_start=0;
	temp_end=0;
	query_start=0;
	query_end=0;
	//---- get start pos ----//
	for(int i=0;i<(int)alignment.size();i++)
	{
		if(alignment[i].first>0 && alignment[i].second>0)
		{
			align_start = i;
			temp_start = alignment[i].first;
			query_start = alignment[i].second;
			break;
		}
	}
	//---- get end pos ----//
	for(int i=(int)alignment.size()-1;i>=0;i--)
	{
		if(alignment[i].first>0 && alignment[i].second>0)
		{
			align_end = i;
			temp_end = alignment[i].first;
			query_end = alignment[i].second;
			break;
		}
	}
	
	//---- get gap number ---//
//	int sum = 0;
	int align_sum=0;
	int seq_gap=0;
	int temp_gap=0;
//	int mid_gap_flag=0;
	for(int i=0;i<(int)nam1_full.length();i++)
	{
		if(nam1_full[i]=='-' && i>=align_start && i<= align_end)
			temp_gap++;
		if(nam2_full[i]=='-' && i>=align_start && i<= align_end)
			seq_gap++;
		if(nam1_full[i]!='-' && nam2_full[i]!='-')
			align_sum ++;
	}

	//---- assign result ----//
	template_range.first = temp_start;
	template_range.second = temp_end;
	query_range.first = query_start;
	query_range.second = query_end;
	aaa[0] = align_sum;
	aaa[1] = seq_gap;
	aaa[2] = temp_gap;
	aaa[4] = nam1_content.length();
	return nam2_content;
}

//----------- save to file ------------//
void SaveToFile(string file,string temp_name,string seq_name,
	string &template_content,string &sequence_content,
	vector<pair<int,int> > &alignment,string &hhpred_styple_output,
	double ali_score)
{
	//--- fasta style ---//
	string fasta_output = file + "/" + temp_name + "-" + seq_name + ".fasta";
	FILE* fp = fopen(fasta_output.c_str(), "wb");
	fprintf(fp, ">%s", temp_name.c_str());
	for (int i = 0; i < (int)alignment.size(); i++) 
	{
		if (i % 10000 == 0)
			fprintf(fp, "\n");
		if (alignment[i].first <= 0)
			fprintf(fp, "-");
		else
			fprintf(fp, "%c", template_content[alignment[i].first - 1]);
	}
	fprintf(fp, "\n\n\n");
	//output template content
	fprintf(fp, ">%s", seq_name.c_str());
	for (int i = 0; i < (int)alignment.size(); i++) 
	{
		if (i % 10000 == 0)
			fprintf(fp, "\n");
		if (alignment[i].second <= 0)
			fprintf(fp, "-");
		else
			fprintf(fp, "%c", sequence_content[alignment[i].second - 1]);
	}
	//end
	fprintf(fp, "\n\n");
	fclose(fp);

	//--- hhpred style ---//
	if(OUT_LEVEL>0)
	{
		string hhpred_output = file + "/" + temp_name + "-" + seq_name + ".cnfpred";
		ofstream outfile(hhpred_output.c_str());
		if(OUT_LEVEL>1)
		{
			pair<int,int> template_range,query_range;
			vector<int> aaa(4,0);
			int idrate;
			string path=file + "/" + temp_name + "-" + seq_name + ".fasta";
			detect_alignment_range(path,template_range,query_range,aaa,idrate);
			outfile << setiosflags(ios::left)<<setw(5)<<"No"<<setiosflags(ios::left)<<setw(12)<<"Template"<<setw(12)<<"tLength"
			<<setw(12)<<"Query"<<setw(12)<<"qLength"<<setw(12)<<"Score"<<setw(12)<<"tRange"<<setw(12)<<"qRange"
			<<setw(12)<<"#Cols"<<setiosflags(ios::left)<<setw(12)<<"#tGaps"<<setiosflags(ios::left)
			<<setw(12)<<"#qGaps"<<setw(12)<<"#seqID"<<endl;
			string query_scale = convertInt(query_range.first) + "-" + convertInt(query_range.second);
			string template_scale = convertInt(template_range.first) + "-" + convertInt(template_range.second);
			outfile <<setiosflags(ios::left)<<setw(5)<<"1"
			<<setiosflags(ios::left)<<setw(12)<<temp_name
			<<setiosflags(ios::left)<<setw(12)<<template_content.length()
			<<setiosflags(ios::left)<<setw(12)<<seq_name
			<<setiosflags(ios::left)<<setw(12)<<sequence_content.length()
			<<setiosflags(ios::left)<<setw(12)<<setprecision(4)<<ali_score
			<<setiosflags(ios::left)<<setw(12)<<template_scale
			<<setiosflags(ios::left)<<setw(12)<<query_scale
			<<setiosflags(ios::left)<<setw(12)<<aaa[0]
			<<setiosflags(ios::left)<<setw(12)<<aaa[2]
			<<setiosflags(ios::left)<<setw(12)<<aaa[1]
			<<setiosflags(ios::left)<<setw(12)<<idrate;
			outfile << endl;
		}
		outfile<<hhpred_styple_output;
		outfile.close();
	}
}

//============== HHpred Style Output ==========//
char HHpred_Score_Symbol(double input)
{
	//switch
	int result=(int)input;
	if(input>=15)result=15;
	else if(input<=-7)result=-7;
	switch(result)
	{
		case 15:return '|';
		case 14:return '|';
		case 13:return '|';
		case 12:return '+';
		case 11:return '+';
		case 10:return '+';
		case 9:return '*';
		case 8:return '*';
		case 7:return '*';
		case 6:return '*';
		case 5:return '~';
		case 4:return '~';
		case 3:return '~';
		case 2:return '~';
		case 1:return '.';
		case 0:return '.';
		case -1:return '.';
		case -2:return '-';
		case -3:return '-';
		case -4:return '-';
		case -5:return '=';
		case -6:return '=';
		case -7:return '=';
		default:return '.';
	}
}
void HHpred_Style_Output(vector<pair<int, int> > &alignment,vector <double> &score,
					     TEMPLATE *temp,SEQUENCE *seq,string &ws_output_tot,
						 int threscut=80)
{
	ws_output_tot="";
	//init name
	string nam1=temp->temp_name;
	string nam2=seq->seq_name;
	if(nam1.size()>15)nam1=temp->temp_name.substr(0,15);
	if(nam2.size()>15)nam2=seq->seq_name.substr(0,15);
	//start
	int i;
	int x,y;
	int wsstart;
	int wsend=0;
	int size=(int)alignment.size();
	int moln1=temp->tLength;
	int moln2=seq->length;
	//midbody output
	//omit head gap
	int start1,start2;
	int end1,end2;
	x=0;
	y=0;
	for(i=0;i<size;i++)
	{
		x = alignment[i].first;
		y = alignment[i].second;
		wsstart=i;
		if(x>0 && y>0)break;
	}
	if(x==0 || y==0)return;
	x--;
	y--;
	start1=x;
	start2=y;
	end1=x;
	end2=y;
	//omit tail gap
	for(i=size-1;i>=0;i--)
	{
		x = alignment[i].first;
		y = alignment[i].second;
		wsend=i;
		if(x>0 && y>0)break;
	}
	//calc
	int first=1;
	int lali=0;
	char sse,acc;
	char wstmp;
	int sse_conf,acc_conf;
	string acc1,sse1,ami1,acc2,sse2,ami2;
	string conf_acc2,conf_sse2;
	string score_out;
	//string clear
	acc1.clear();
	sse1.clear();
	ami1.clear();
	acc2.clear();
	sse2.clear();
	ami2.clear();
	conf_acc2.clear();
	conf_sse2.clear();
	score_out.clear();
	//output related
	char ws_output[60000];
	string ws_output_str;
	ws_output_str.clear();
	ws_output_tot.clear();
	//[real process]
	int num=0;
	for(i=wsstart; i <= wsend; i++)
	{
		x = alignment[i].first;
		y = alignment[i].second;
		x--,y--;
		//output
		if(num%threscut==0 && first==0)
		{
			//fragment output
			ws_output_str.clear();
			sprintf(ws_output,"\n");
			ws_output_str+=ws_output;
			sprintf(ws_output,"T sse_real            %s           \n",sse1.c_str());
			ws_output_str+=ws_output;
			sprintf(ws_output,"T acc_real            %s           \n",acc1.c_str());
			ws_output_str+=ws_output;
			sprintf(ws_output,"T %-15s%4d %s %4d (%d)\n",
				nam1.c_str(),start1+1,ami1.c_str(),end1+1,moln1);
			ws_output_str+=ws_output;
			sprintf(ws_output,"                      %s           \n",score_out.c_str());
			ws_output_str+=ws_output;
			sprintf(ws_output,"S %-15s%4d %s %4d (%d)\n",
				nam2.c_str(),start2+1,ami2.c_str(),end2+1,moln2);
			ws_output_str+=ws_output;
			sprintf(ws_output,"S acc_pred            %s           \n",acc2.c_str());
			ws_output_str+=ws_output;
			sprintf(ws_output,"S acc_conf            %s           \n",conf_acc2.c_str());
			ws_output_str+=ws_output;
			sprintf(ws_output,"S sse_pred            %s           \n",sse2.c_str());
			ws_output_str+=ws_output;
			sprintf(ws_output,"S sse_conf            %s           \n",conf_sse2.c_str());
			ws_output_str+=ws_output;
			sprintf(ws_output,"\n");
			ws_output_str+=ws_output;
			//string clear
			acc1.clear();
			sse1.clear();
			ami1.clear();
			acc2.clear();
			sse2.clear();
			ami2.clear();
			conf_acc2.clear();
			conf_sse2.clear();
			score_out.clear();
			//position update
			start1=end1+1;
			start2=end2+1;
			//final output
			ws_output_tot+=ws_output_str;
		}
		num++;
		//lali
		if(x>=0 && y>=0)lali++;
		if(x>=0)end1=x;
		if(y>=0)end2=y;
		first=0;
		//record
		//[temp]
		if(x>=0 && temp->isMissing[x]!=1)
		{
			if(temp->ACC[x]==0)acc='B';
			else if(temp->ACC[x]==1)acc='M';
			else acc='E';
			if(temp->SS[x]==0)sse='H';
			else if(temp->SS[x]==1)sse='E';
			else sse='C';
			acc1=acc1+acc;
			sse1=sse1+sse;
			ami1=ami1+temp->sequence[x];
		}
		else
		{
			if(x>=0 && temp->isMissing[x]==1)ami1=ami1+temp->sequence[x];
			else ami1=ami1+'-';
			acc1=acc1+'-';
			sse1=sse1+'-';
		}
		//[targ]
		if(y>=0)
		{
			if(seq->ACC[y]==0)acc='B';
			else if(seq->ACC[y]==1)acc='M';
			else acc='E';
			if(seq->SS[y]==0)sse='H';
			else if(seq->SS[y]==1)sse='E';
			else sse='C';
			acc2=acc2+acc;
			sse2=sse2+sse;
			ami2=ami2+seq->sequence[y];
			//[conf]
			acc_conf=(int)(10*seq->acc_our_10_42[y][seq->ACC[y]]);
			if(acc_conf<0)acc_conf=0;
			else if(acc_conf>9)acc_conf=9;
			sse_conf=(int)(10*seq->SS2[y][seq->SS[y]]);
			if(sse_conf<0)sse_conf=0;
			else if(sse_conf>9)sse_conf=9;
			wstmp=acc_conf+'0';
			conf_acc2=conf_acc2+wstmp;
			wstmp=sse_conf+'0';
			conf_sse2=conf_sse2+wstmp;
		}
		else
		{
			ami2=ami2+'-';
			acc2=acc2+'-';
			sse2=sse2+'-';
			conf_acc2=conf_acc2+'-';
			conf_sse2=conf_sse2+'-';
		}
		//[score]
		if(x>=0 && y>=0)
		{
			wstmp=HHpred_Score_Symbol(score[lali-1]);
			score_out=score_out+wstmp;
		}
		else
		{
			score_out=score_out+" ";
		}
	}

	//termi_iprocess
//	if(i%threscut==0 && first==0)
	{
		//fragment output
		ws_output_str.clear();
		sprintf(ws_output,"\n");
		ws_output_str+=ws_output;
		sprintf(ws_output,"T sse_real            %s           \n",sse1.c_str());
		ws_output_str+=ws_output;
		sprintf(ws_output,"T acc_real            %s           \n",acc1.c_str());
		ws_output_str+=ws_output;
		sprintf(ws_output,"T %-15s%4d %s %4d (%d)\n",
			nam1.c_str(),start1+1,ami1.c_str(),end1+1,moln1);
		ws_output_str+=ws_output;
		sprintf(ws_output,"                      %s           \n",score_out.c_str());
		ws_output_str+=ws_output;
		sprintf(ws_output,"S %-15s%4d %s %4d (%d)\n",
			nam2.c_str(),start2+1,ami2.c_str(),end2+1,moln2);
		ws_output_str+=ws_output;
		sprintf(ws_output,"S acc_pred            %s           \n",acc2.c_str());
		ws_output_str+=ws_output;
		sprintf(ws_output,"S acc_conf            %s           \n",conf_acc2.c_str());
		ws_output_str+=ws_output;
		sprintf(ws_output,"S sse_pred            %s           \n",sse2.c_str());
		ws_output_str+=ws_output;
		sprintf(ws_output,"S sse_conf            %s           \n",conf_sse2.c_str());
		ws_output_str+=ws_output;
		sprintf(ws_output,"\n");
		ws_output_str+=ws_output;
		//string clear
		acc1.clear();
		sse1.clear();
		ami1.clear();
		acc2.clear();
		sse2.clear();
		ami2.clear();
		conf_acc2.clear();
		conf_sse2.clear();
		score_out.clear();
		//position update
		start1=end1+1;
		start2=end2+1;
		//final output
		ws_output_tot+=ws_output_str;
	}
	//final check
	if((int)score.size()!=lali)
	{
		fprintf(stderr,"input score length not equal to lali ! [%d!=%d]\n",
			(int)score.size(),lali);
		exit(-1);
	}
}

