//------- load templist file ------//
int Load_Temp_List(string& list_file, vector<string >& temp_list)
{
	ifstream fin;
	string buf,temp;
	fin.open(list_file.c_str(), ios::in);
	if(fin.fail()!=0)
	{
		fprintf(stderr,"template list file not found [%s] !!!\n",list_file.c_str());
		exit(-1);
	}
	temp_list.clear();
	int count=0;
	for(;;)
	{
		if(!getline(fin,buf,'\n'))break;
		temp_list.push_back(buf);
		count++;
	}
	return count;
}


//--------- single pair process ----------//
double Ma_CNFalign_norm(TEMPLATE* t,SEQUENCE* s,int &lali,
	vector<State> &states,vector<Transition> &transitions,
	string result_root, string post_root)
{
	//--- init ---//
	CNFalign_Calc * align = new CNFalign_Calc(t, s, DISO_THRES);
	align->SetStatesAndTransitions(states, transitions);
	align->GenerateFeatures();
	align->Set_Inner_Data();
	align->SetWeights(CNFpred_Model_rel);
	//--- alignment ---//
	align->ComputeGap_Gate_Output();
	align->Compute_Match_Protential();
	align->TRACE_THRES=TRACE_THRES;
	align->BOUND_THRES=BOUND_THRES;
	vector<double> align_score_vector;
	vector<pair<int, int> > alignmentResult;
	double score=align->ComputeViterbi2(alignmentResult,align_score_vector,lali,1);

	//--- output ---//
	if(result_root.length()!=0){
		string hhpred_style_output="";
		if(OUT_LEVEL>0)HHpred_Style_Output(alignmentResult,align_score_vector,t,s,hhpred_style_output,80);
		if(DSSPorSEQ==0)SaveToFile(result_root,t->temp_name,s->seq_name,t->sequence,s->sequence,alignmentResult,hhpred_style_output,score); //output SEQRES in TPL
		else SaveToFile(result_root,t->temp_name,s->seq_name,t->dssp_sequence,s->sequence,alignmentResult,hhpred_style_output,score);       //output DSSP in TPL
	}
	if( post_root.length()!=0 ){
		//-> get bound //
		align->Bound_Detect_Given_Alignment(alignmentResult);  //__130408__//
		//-> output post //
		string post_file = post_root + "/" + t->temp_name+"-"+s->seq_name+".post";
		align->ComputeForward();
		align->ComputeBackward();
		align->PrintPosterior(post_file);
	}

	//--- delete ---//
	delete align;
	//--- return ---//
	return score;
}
double Ma_CNFalign_pure(SEQUENCE* t,SEQUENCE* s,int &lali,
	vector<State> &states,vector<Transition> &transitions,
	string result_root, string post_root)
{
	//--- init ---//
	CNFalign_Calc * align = new CNFalign_Calc(t, s, DISO_THRES);
	align->SetStatesAndTransitions(states, transitions);
	align->GenerateFeatures();
	align->Set_Inner_Data();
	align->SetWeights(CNFpred_Model_rel);
	//--- alignment ---//
	align->ComputeGap_Gate_Output();
	align->Compute_Match_Protential();
	align->TRACE_THRES=TRACE_THRES;
	align->BOUND_THRES=BOUND_THRES;
	vector<double> align_score_vector;
	vector<pair<int, int> > alignmentResult;
	double score=align->ComputeViterbi2(alignmentResult,align_score_vector,lali,0);
	//--- output ---//
	if(result_root.length()!=0)
	{
		string hhpred_style_output="";
		if(OUT_LEVEL>0)HHpred_Style_Output_pure(alignmentResult,align_score_vector,t,s,hhpred_style_output,80);
		SaveToFile(result_root,t->seq_name,s->seq_name,t->sequence,s->sequence,alignmentResult,hhpred_style_output,score); //output SEQRES in TPL
	}
	if( post_root.length()!=0 )
	{
		//-> get bound //
		align->Bound_Detect_Given_Alignment(alignmentResult);  //__130408__//
		//-> output post //
		string post_file = post_root + "/" + t->seq_name+"-"+s->seq_name+".post";
		align->ComputeForward();
		align->ComputeBackward();
		align->PrintPosterior(post_file);
	}
	//--- delete ---//
	delete align;
	//--- return ---//
	return score;
}


