double WS_GenSin_Align(HMM* t,HMM* q,string fasta_out,Hit *hit,double mact=0.1) 
{
	//Viterbi alignment
	hit->Viterbi(q,t);
	hit->Backtrace(q,t);
	//MAC re-align around viterbi
	if(mact>=0.0)
	{
		hit->mact=mact;    // -mact 0.1 set here !!
		hit->realign_around_viterbi=true;
		hit->Forward(q,t);
		hit->Backward(q,t);
		hit->MACAlignment(q,t);
		hit->BacktraceMAC(q,t);
	}
	//output alignment
	if(fasta_out!="")
	{
		int i;
		int ii,jj;
		int moln1=t->L;
		int moln2=q->L;
		int *ali1=new int[moln1];
		int *ali2=new int[moln2];
		for(i=0;i<moln1;i++)ali1[i]=-1;
		for(i=0;i<moln2;i++)ali2[i]=-1;
		int count=hit->wsteps;
		for(i=0;i<count;i++)
		{
			ii=hit->wwj[i];
			jj=hit->wwi[i];
			if(ii>0 && jj>0)
			{
				ali1[ii-1]=jj-1;
				ali2[jj-1]=ii-1;
			}
		}
		FILE *fp=fopen(fasta_out.c_str(),"wb");
		string nam1,nam2;
		string name1,name2;
		name1=t->name;
		name2=q->name;
		getBaseName(name1,nam1,'/','.');
		getBaseName(name2,nam2,'/','.');
		FASTA_Output(fp,nam1,nam2,t->seq,q->seq,ali1,ali2,moln1,moln2);
		fclose(fp);
		delete [] ali1;
		delete [] ali2;
	}
	//output score
	return hit->score;
}
void WS_GenSin_Align_Total(string &query_file,vector <string> &temp_list,vector <double> &temp_score,
	string &temp_root,int pseudo=1,double mact=0.1,int wsmax=15000)
{
	//claim hmm
	HMM *t = new HMM;   // template hhm
	HMM *q = new HMM;   // query hhm
	int retv;
	//load query
	FILE* inf = fopen(query_file.c_str(), "r");
	if(inf==NULL)
	{
		fprintf(stderr,"query_file %s not found ! \n",query_file.c_str());
		exit(-1);
	}
	retv=q->Read_TGT(inf);  //-> read TGT file for query
	fclose(inf);
	if(retv!=1)
	{
		fprintf(stderr,"query_file %s bad ! \n",query_file.c_str());
		exit(-1);
	}
	//claim hit
	Hit *hit=new Hit;
	hit->AllocateTempMatrix(2*(wsmax+2) );
	hit->AllocateBacktrace(2*(q->L+2),2*(wsmax+2) );
	hit->AllocateBacktraceMatrix(2*(q->L+2),2*(wsmax+2) );
	hit->AllocateForwardMatrix(2*(q->L+2),2*(wsmax+2) );
	hit->AllocateBackwardMatrix(2*(q->L+2),2*(wsmax+2) );
	//init query
	if(pseudo!=1)q->has_pseudocounts=true;
	q->AddTransitionPseudocounts();
	q->PreparePseudocounts();
	q->AddAminoAcidPseudocounts();
	q->CalculateAminoAcidBackground();
	q->Log2LinTransitionProbs(1.0);

	//----------- load templist ---------//
	temp_score.clear();
	int size=(int)temp_list.size();
	int outsize=size/100;
	if(outsize==0)outsize=1;
	for(int i=0;i<size;i++)
	{
		//init score
		temp_score.push_back(99999);
		//load template
		string temp_file=temp_root+"/"+temp_list[i]+".tpl";
		inf=fopen(temp_file.c_str(), "r");
		if(inf==NULL)
		{
			fprintf(stderr,"warning: tpl_file %s not found ! \r",temp_file.c_str());
			fclose(inf);
			continue;
		}
		retv=t->Read_TPL(inf);  //-> read TPL file for query
		fclose(inf);
		if(retv!=1)
		{
			fprintf(stderr,"warning: tpl_file %s bad ! \r",temp_file.c_str());
			continue;
		}
		//init template
		if(pseudo!=1)t->has_pseudocounts=true;
		t->AddTransitionPseudocounts();
		t->PreparePseudocounts();
		t->AddAminoAcidPseudocounts();
		t->CalculateAminoAcidBackground();
		t->Log2LinTransitionProbs(1.0);
		t->IncludeNullModelInHMM(q,t);  // Can go BEFORE the loop if not dependent on template
		//run GenSin_align
		string fasta_out="";
		double score=WS_GenSin_Align(t,q,fasta_out,hit,mact);
		temp_score[i]=score;
	}
	//delete
	delete t;
	delete q;
	delete hit;
}
